Callbacks:
on_load{ 'Empirical Trough SCA' } = define()
{
	on_change{ 'sca_library' }();
	on_change{ 'use_sca_library_values' }();
};

on_change{ 'sca_library' } = define() {

  state = value('use_sca_library_values');

  if ( state == 1 ) {  

	value( 'ScaLen'              , value('lib_ScaLen')               );
	value( 'SCA_aper'            , value('lib_SCA_aper')             );
	value( 'ui_sca_aperture_area', value('lib_ui_sca_aperture_area') );
	value( 'Ave_Focal_Length'    , value('lib_Ave_Focal_Length')     );
	value( 'IamF0'               , value('lib_IamF0')                );
	value( 'IamF1'               , value('lib_IamF1')                );
	value( 'IamF2'               , value('lib_IamF2')                );
	value( 'TrkTwstErr'          , value('lib_TrkTwstErr')           );
	value( 'GeoAcc'              , value('lib_GeoAcc')               );
	value( 'MirRef'              , value('lib_MirRef')               );
	value( 'MirCln'              , value('lib_MirCln')               );
	value( 'ui_HCEdust'          , value('lib_HCEdust')              );
	value( 'ConcFac'             , value('lib_ConcFac')              );
	value( 'SfAvail'             , value('lib_SfAvail')              );
  }

};

on_change{'use_sca_library_values'} = define() {

	state = value('use_sca_library_values');

	enable( 'sca_library'         , state == 1 );

	enable( 'ScaLen'              , state == 0 );
	enable( 'SCA_aper'            , state == 0 );
	enable( 'ui_sca_aperture_area',	state == 0 );
	enable( 'Ave_Focal_Length'    ,	state == 0 );
	enable( 'IamF0'               ,	state == 0 );
	enable( 'IamF1'               ,	state == 0 );
	enable( 'IamF2'               ,	state == 0 );
	enable( 'TrkTwstErr'          ,	state == 0 );
	enable( 'GeoAcc'              ,	state == 0 );
	enable( 'MirRef'              ,	state == 0 );
	enable( 'MirCln'              ,	state == 0 );
	enable( 'ui_HCEdust'          ,	state == 0 );
	enable( 'ConcFac'             ,	state == 0 );
	enable( 'SfAvail'             ,	state == 0 );
};
